import './App.css';
import axios from "axios";
import { useEffect , useState} from "react";

function App() {

  const [test, setTest] = useState();

  useEffect(()=>{
    axios.get("http://localhost:3001/patient").then((response)=>{
      setTest(response.data);
    })
  },[])

  return <div className='App'>{test}</div>;
}

export default App;
